ControlPropertyState.AutoRuleBindingString:
If( Fecha_Incicio.SelectedDate+6 <> Fecha_Fin.SelectedDate,
    Notify(
        "Fechas ingresadas Invalidas",
        NotificationType.Error
    ),
    If(Total_Horas_Trabajadas.Text <> 48,
        Notify(
            "Horas totales Trabajadas invalidas, deben ser 48 horas",
            NotificationType.Error
        ),
        If(IsBlank(Fecha_Incicio.SelectedDate) || IsBlank(Fecha_Fin.SelectedDate),
            Notify(
            "Debe ingresar las fechas de inicio y fin de semana",
            NotificationType.Error
        ),
            SubmitForm(Form18)
        )
    )
)
